import { Link, useParams } from 'react-router-dom';
import { useEffect, useState } from 'react';
import * as API from '../services/Cards.js';
import { POKE_IMAGE_BASE } from '../constants.js';

export default function PokemonList() {
    const { editionId } = useParams()
    const [cards, setCards] = useState([])

    useEffect(() => {
        API.getDataByEdition().then(setCards)
    }, [])
    console.log(cards)
    return (
        <>
            {/* <img src={LOGO} width={300} alt='PokÃ©mon'/> */}
            {cards.cards != null && cards.cards.map(p => CardData(p))}
        </>
    );
}

const CardData = (card) =>
    <Link key={card.name} to={`pokemon/${card.url.split('/')[card.url.split('/').length - 2]}`}>
        <img
            width={230}
            alt={card.name}
            key={card.name}
            src={`${POKE_IMAGE_BASE}${card.name}.jpg`}
        />
